import React from 'react';
import { View, Text, Image, ScrollView, StyleSheet } from 'react-native';

const Profile = () => {
  return (
    <ScrollView>
      <View style={styles.container}>
        <View style={styles.leftBox}>
          <Text style={styles.boxTitle}>Previous Game List</Text>
          {/* Add previous game list content here */}
        </View>

        <View style={styles.middleBox}>
          <Text style={styles.boxTitle}>Upcoming Game List</Text>
          {/* Add upcoming game list content here */}
        </View>

        <View style={styles.rightBox}>
          <Text style={styles.middleText}>Welcome, User Name</Text>
          <Image
            source={{ uri: 'https://example.com/fake-pic.jpg' }}
            style={styles.image}
          />
          <View style={styles.box}>
            <Text style={styles.boxTitle}>Assigned Groups</Text>
            {/* Add options for assigned groups */}
            <Text>Group One</Text>
            <Text>Group Two</Text>
            <Text>Group Three</Text>
            {/* ... Add more options as needed */}
          </View>
        </View>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexDirection: 'row',
  },
  leftBox: {
    flex: 1,
    backgroundColor: 'white',
    borderRadius: 10,
    borderWidth: 1,
    borderColor: 'black',
    padding: 10,
    margin: 10,
  },
  middleBox: {
    flex: 1,
    backgroundColor: 'white',
    borderRadius: 10,
    borderWidth: 1,
    borderColor: 'black',
    padding: 10,
    margin: 10,
  },
  rightBox: {
    flex: 1,
    backgroundColor: 'white',
    borderRadius: 10,
    borderWidth: 1,
    borderColor: 'black',
    padding: 10,
    margin: 10,
  },
  boxTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    marginTop: 10,
  },
  middleText: {
    fontSize: 24,
    fontWeight: 'bold',
  },
  image: {
    width: 200,
    height: 200,
    marginTop: 10,
  },
});

export default Profile;
